Discover the secret of Rachel's past in Howlville: The Dark Past! Many years ago an artifact was found in a mine near the small town of Howlville. The government asked Dr. Joseph and a group of scientists to examine it. Something went wrong and the experiments were halted and classified. The town closed off. Since then nobody knew what happened to Dr. Joseph. Fifteen years later his daughter Rachel is on the verge of solving the mystery, but somebody is doing everything possible to keep her from succeeding. Help find Rachel's father and save the world from the looming catastrophe!

Explore mysterious Howlville
Play challenging mini-games
Find your father and save the world!

